import React from 'react';
import helpPhoto from '../images/Group 46.png'; // Import the help photo
import dashboardImage from '../images/moptro logo.png'; // Import the dashboard image

const Home = () => {
  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

  return (
    <div>
      <img src={helpPhoto} alt="Help" style={{ position: 'absolute', top: '20px', right: '20px' }} />
      <div style={{width: '71px', height: '70px' }} className='profile-pic'>
        <img src={dashboardImage} alt="Dashboard" style={{ width: '100%', height: '100%' }} />
      </div>
      <div className='container'>
        <div className='container_heading'>
          <h2 className='container_headingText'>Employee Productivity Dashboard</h2>
        </div>
        {daysOfWeek.map(day => (
          <div key={day} className='container_label'>
            Productivity on {day}:
            <span className='progressBar_percentage'>4%</span>
            <div className='progressBar' style={{width: '6px'}}></div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
